import React, {useContext, useEffect, useState} from "react";
import { catalog } from "../http/CatalogApi";
import { Button, Form } from "react-bootstrap";
import {observer} from "mobx-react-lite";
import Header from "./Header";
import Logo from "../assets/logo1.png"
import ImageBasket from "../assets/basket.png"
const Catalog =observer(() => {

    const [jest,setJest] = useState(false)
    var jest1 = useEffect(()=>{
        console.log('что-то поменялось')
    })
    const signIn = async () =>{
            const response1234 = await catalog()
            setJest(!jest)
            console.log(jest)
    }
    return(
        <div>
            <Header />
            <div style={{display:'block', height: '100px', background: '#d8d1d1'}}>
                <div style={{display:'flex', paddingLeft: '10%', paddingRight: '10%', justifyContent:'space-between', alignItems: 'center'}}>
                        <div style={{}}> 
                            <div
                                style={{display: 'inline-block', background: `url(${Logo}) no-repeat center center`, width:150, height: 80, backgroundSize: 'cover', fontSize:64}}>
                            </div>
                        </div>
                        <div style={{paddingLeft: '10%', width: '500px'}}>                    
                            <div style={{display: 'flex', background: '#79b260',minHeight: 50, maxHeight: 50, alignItems: 'center', justifyContent: 'center'}}>
                            <Form style={{minWidth: 300,maxWidth: '100%'}}>
                                <Form.Control
                                    placeholder = "Поиск"
                                />
                            </Form>
                        </div>
                        </div>
                    <div style={{paddingLeft: 150, display: 'block', marginLeft: '50px', flexDirection: '2'}}>
                        <div style={{}}> 
                            <div
                                style={{display: 'inline-block', background: `url(${ImageBasket}) no-repeat center center`, minHeight: 30, minWidth: 30, backgroundSize: 'cover', fontSize:64}}>
                            </div>
                        </div>
                    </div>
                </div>

            </div>
            <div style={{paddingLeft: '8%', paddingRight: '8%'}}>
                
                <Button onClick={signIn}>Нажми</Button>
                {jest ?
                    <div>Авторизован</div>
                    :
                    <div>Не авторизован</div>
                }
        </div>
        </div>
    );
})

export default Catalog;
